var app=angular.module("ftpgui",[]);app.controller("FileListCtrl",["$scope","$http",function(e,o){return o({method:"GET",url:"http://localhost:8080/files"}).success(function(o,l,t,n){e.files=o,console.log(e.files.length+" files(s) retreived.")}).error(function(o,l,t,n){console.log("Echec "+l),e.files=[]})}]),app.controller("ActionCtrl",["$scope","$http",function(e,o){e["delete"]=function(){return o({method:"DELETE",url:"http://localhost:8080/file/"+e.file.name}).success(function(o,l,t,n){console.log(e.file.name+" deleted")}).error(function(e,o,l,t){console.log("Echec "+o)})}}]);